import React from 'react';
import './App.css';
import emotion from "./Icons/Small Icons/mood-24px-grey.svg";
import tactor from "./Icons/Small Icons/tactor-grey.svg";
import behavior from "./Icons/Small Icons/touch-grey.svg";
import neutral from "./Icons/Emotion/Emotion_Neutral.svg";
import squeezeb from "./Icons/Tactor/Gesture icons_Squeeze-15.svg";
import happiness from "./Icons/Emotion/Emotion_Happiness .svg";
import fear from "./Icons/Emotion/Emotion_Fear.svg";
import sympathy from "./Icons/Emotion/Emotion_Sympathy.svg";
import sadness from "./Icons/Emotion/Emotion_Sadness.svg";
import anger from "./Icons/Emotion/Emotion_Anger.svg";
import disgust from "./Icons/Emotion/Emotion_Disgust.svg";
import love from "./Icons/Emotion/Emotion_Love.svg";
import gratitude from "./Icons/Emotion/Emotion_Gratitude.svg";
import shakew from "./Icons/Tactor/Gesture icons_Shake_wht.svg"
import squeezew from "./Icons/Tactor/Gesture icons_Squeeze_wht.svg";
import hitb from "./Icons/Tactor/Gesture icons_Hit.svg";
import patb from "./Icons/Tactor/Gesture icons_Pat-14.svg";
import pushb from "./Icons/Tactor/Gesture icons_Push-21.svg";
import rubb from "./Icons/Tactor/Gesture icons_Rub-18.svg";
import strokeb from "./Icons/Tactor/Gesture icons_Stroke.svg";
import tapb from "./Icons/Tactor/Gesture icons_Tap-17.svg";
import Emotion from './emotion';

//TO DO: Add the emotion and placeholders to the left bar.
//Allow users to go home with the top navigation
//Allow users to clear selection of tactor and emotion
//Add graph and sliders
//Add serial library
//Add Archive


class LeftNav extends React.Component{



constructor(props) {
  super(props);
  this.state = {
    home: true,
    emotion: false,
    tactor: false,
    eselected:false,
    eicon: null,
    ename: null,
  };
}

handleClick(name) {
  switch (name) {
    case "emotion":
      this.setState({ home: false, emotion:true, tactor: false});
      break;
    case "tactor":
      this.setState({home: false, emotion: false, tactor: true});
      break;
  }
}

emotionSelect(name){
this.setState({eselected:true});
  switch (name) {
    case "happiness":
      this.setState({eicon:happiness, ename: "Happiness"});
      break;
    case "fear":
        this.setState({eicon:fear, ename: "Fear"});
        break;
    case "sympathy":
        this.setState({eicon: sympathy, ename: "Sympathy"});
        break;
    case "sadness":
      this.setState({eicon: sadness, ename: "Sadness"});
      break;
    case "anger":
      this.setState({eicon: anger, ename: "Anger"});
      break;
    case "disgust":
      this.setState({eicon: disgust, ename:"Disgust"});
      break;
    case "love":
      this.setState({eicon: love, ename: "Love"});
      break;
    case "gratitude":
      this.setState({eicon: gratitude, ename:"Gratitude"});

  }


}


  render(){
    var shake = shakew;
    var squeeze = squeezew;
    var hit = hitb;
    var pat = patb;
    var push = pushb;
    var rub = rubb;
    var stroke = strokeb;
    var tap = tapb;

  return(

      <section class="page-content">
            <div class ="row left-nav group1">
              <div class="col-2 bg-light  sidebar d-flex">
                <div class ="row left-nav group1">
                <div class="col-12 left-col">
                <nav class="navbar left-nav navbar-expand navbar-light">
                <ul class="left-nav nav-item text-left">
                  <li class="left-nav nav-link" href="#"  onClick={() => this.handleClick("emotion")}><a class="left-nav nav-link"><img src={emotion} alt="" class="left-nav icon"/>Emotion</a></li>
                  {this.state.eselected && (
                  <div class="row justify-content-center">
                    <div class="col col-auto bg-white sidebar-emotion-box">
                      <img src={this.state.eicon} alt="" class="emotion-logo happiness sidebar-emotion" />
                      <h4 class="text-center">{this.state.ename}</h4>
                    </div>
                  </div>
                )}
                  <li class="left-nav nav-link" href="#" onClick={() => this.handleClick("tactor")}><a class="left-nav nav-link" ><img src={tactor} alt="" class="left-nav icon"/>Tactor</a></li>
                  <li class="left-nav nav-link" href="#"><a class="left-nav nav-link" onClick={() => alert('click')}><img src={behavior} alt="" class="left-nav icon"/>Behavior</a></li>
                </ul>
              </nav>
                </div>
                </div>

              </div>
              {this.state.home && (

              <div class="col-10 main-content">
              <section class="main-head">


                <h2>Touch Generator</h2>
                <h3>Create a new emotional robot touch clip</h3>

              </section>
              <section class="generator-table">
                <div class="row generator justify-content-center">
                  <div class="col col-auto" >
                    <div class="bg-light touchgen-box touchgen d-flex align-items-center" onClick={() => this.handleClick("emotion")}>
                    <img src={neutral} alt="" class="generator-logo"/>
                  </div>

                    <h4 class="text-center text-uppercase mx-auto">Emotion</h4>

                  </div>
                  <div class="col col-auto d-flex align-items-center">
                    <h2 class="generator">OR</h2>
                    </div>
                  <div class="col col-auto">
                    <div class="bg-light  touchgen-box  touchgen d-flex align-items-center" onClick={() => this.handleClick("tactor")}>
                      <img src={squeezeb} alt="" class="generator-logo"/>
                    </div>
                    <h4 class="text-center text-uppercase mx-auto">Tactor</h4>
                  </div>
                </div>

              </section>
              </div>
            )}
            {this.state.emotion && (
              <div class="col-10 main-content">
              <section class="main-head">


                <h2>Emotion</h2>
                <h3>Select one emotion to start</h3>

              </section>
              <section class="emotion-table">
                <div class="row emotion">
                  <div class="col">
                    <div class="bg-light emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("happiness"), this.handleClick("tactor"))}>
                    <img src={happiness} alt="" class="emotion-logo happiness"/>
                  </div>

                    <h4 class="text-center">Happiness</h4>

                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("fear"), this.handleClick("tactor"))}>
                      <img src={fear} alt="" class="emotion-logo fear"/>
                    </div>
                    <h4 class="text-center">Fear</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center"  onClick={() => (this.emotionSelect("sympathy"), this.handleClick("tactor"))}>
                        <img src={sympathy} alt="" class="emotion-logo sympathy"/>
                    </div>
                    <h4 class="text-center">Sympathy</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center"  onClick={() => (this.emotionSelect("sadness"), this.handleClick("tactor"))}>
                      <img src={sadness} alt="" class="emotion-logo sadness"/>
                    </div>
                    <h4 class="text-center">Sadness</h4>
                  </div>
                </div>
                <div class="row emotion">
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("anger"), this.handleClick("tactor"))}>
                      <img src={anger} alt="" class="emotion-logo anger"/>
                  </div>
                  <h4 class="text-center">Anger</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("disgust"), this.handleClick("tactor"))}>
                      <img src={disgust} alt="" class="emotion-logo disgust"/>
                    </div>
                    <h4 class="text-center">Disgust</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("love"), this.handleClick("tactor"))}>
                      <img src={love} alt="" class="emotion-logo love"/>
                    </div>
                    <h4 class="text-center">Love</h4>
                  </div>
                  <div class="col">
                    <div class="bg-light  emotion-box emotion d-flex align-items-center" onClick={() => (this.emotionSelect("gratitude"), this.handleClick("tactor"))}>
                      <img src={gratitude} alt="" class="emotion-logo gratitude"/>
                    </div>
                    <h4 class="text-center">Gratitude</h4>
                  </div>
                </div>
              </section>
            </div>

            )}
            {this.state.tactor && (
              <div class="col-10 main-content">
                <section class="main-head">


                  <h2>Tactor</h2>
                  <h3>Select one tactor, recommendation is provided based on study</h3>

                </section>
                <section class="emotion-table">
                  <div class="row emotion">
                    <div class="col">
                      <div class="bg-dark emotion-box emotion d-flex align-items-center">
                      <img src={shake} alt="" class="emotion-logo happiness"/>
                    </div>

                      <h4 class="text-center">Shake</h4>

                    </div>
                    <div class="col">
                      <div class="bg-dark  emotion-box emotion d-flex align-items-center">
                        <img src={squeeze} alt="" class="emotion-logo fear"/>
                      </div>
                      <h4 class="text-center">Squeeze</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                          <img src={hit} alt="" class="emotion-logo sympathy"/>
                      </div>
                      <h4 class="text-center">Hit</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                        <img src={pat} alt="" class="emotion-logo sadness"/>
                      </div>
                      <h4 class="text-center">Pat</h4>
                    </div>
                  </div>
                  <div class="row emotion">
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                        <img src={push} alt="" class="emotion-logo anger"/>
                    </div>
                    <h4 class="text-center">Push</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                        <img src={rub} alt="" class="emotion-logo disgust"/>
                      </div>
                      <h4 class="text-center">Rub</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                        <img src={stroke} alt="" class="emotion-logo love"/>
                      </div>
                      <h4 class="text-center">Stroke</h4>
                    </div>
                    <div class="col">
                      <div class="bg-light  emotion-box emotion d-flex align-items-center">
                        <img src={tap} alt="" class="emotion-logo gratitude"/>
                      </div>
                      <h4 class="text-center">Tap</h4>
                    </div>
                  </div>
                </section>
              </div>
            )}

              </div>
          </section>
)
}
}

export default LeftNav;
